import React from 'react';
import myImage from '../images/personal_image.jpg';

function AboutMe() {
  return (
    <section className="about-me" id="aboutme">
      <div className="about-me-text">
        <h1>Who am I?</h1>
        <p>My name is <b>Athul</b>. I'm a Software Engineering student at RMIT University, passionate about technology
          and innovation. Beyond academics, I enjoy exploring new tech, gaming, and refining my programming skills.</p>
        <p>Check out some of my projects!</p>
      </div>
      <img src={myImage} alt="This is me" />
    </section>
  );
}

export default AboutMe;
